column8:
クローゼットに洋服に並べて掛けて<BR>
Ｙシャツや小物を収納する便利な収納用品<BR><BR>


メッシュのポケットは通風が良く<BR>
中の物が見えるので、捜し易いです。<BR><BR>
表側３枚、裏側３枚の両面に収納ができるので、一週間分のＹシャツを楽々収納できます。<BR>
サイドにはネクタイをことができ、右下に小さなポケットを配置してあるので、ハンカチなどの小物も収納できます。<BR>
<BR>
ハンガーの付け根部分が回転するので、クローゼット以外にカーテンラックなどにもひっかけることができます。<BR><BR>


サイズ：約幅45cm×高さ85cm<BR>
<BR>
素材：台布：ポリエステル<BR>
ポケット：メッシュ生地<BR>
<BR><BR>
【関連商品】<BR>
