</TD><TD>
ワイシャツと身に付ける小物をまとめて収納<BR>
小さいポケットが５個と大きなポケットが２個付いています。<BR><BR>

台布は厚手の合皮を使用。ポケットはメッシュなので、中の物が見やすい。<BR>
ただいま、お試しタイムセール中のため、<BR>
2800円のお品が1999円(税込み)
</TD></TR></TABLE>
